def read_txt(x, y):  # read a fasta file x and store into a list y
    file = open(x, "r")
    for line in file:
        y.append(line)


def write_csv(x, y):  # write list x into file y
    with open(y, 'w+') as file:
        wr = csv.writer(file, dialect='excel')
        wr.writerows(x)
    file.close()


group_accession_dict = dict()
def main():
    global row_need_identify

    read_txt(group_txt_file, group_txt_list)

    count_group = 0
    current_group = None
    for i in group_txt_list:
        if 'Group' in i:
            count_group += 1
            current_group = i.strip().strip(":")  # update current group
            group_accession_dict[current_group] = []
        else:
            group_accession_dict[current_group].append(i.strip())

    print(f"check: {count_group} groups total")

    print(f"check group-sccession dict: len = {len(group_accession_dict)}")

    # convert to list
    row_need_identify = re.sub("\s+", ",", row_need_identify).split(',')
    row_need_identify = [i for i in row_need_identify]
    print(f"{len(row_need_identify)} groups need to be identified")
    list_of_groups = list()
    for g in row_need_identify:
        list_of_groups.append(g.split('+'))
    output_list = list()
    for l in list_of_groups:
        find_name = None
        for key in group_accession_dict:
            if l[0] in group_accession_dict[key]:
                find_name = key
        output_list.append([find_name, l])


    write_csv(output_list, output_file)



main()




